  courts,
  computedById,
  selectedId,
  onSelect,
}) {
  if (!courts.length) {
    return (
      <div className="card" style={{ textAlign: "center" }}>
        <div style={{ fontSize: 20, fontWeight: 800 }}>
          No matches ðŸ¥²
