        <div style={{ color: "#64748b", marginTop: 8 }}>
          Try a different search term.
        </div>
      </div>
    );
  }

  return (
    <div>
      {courts.map((c) => (
        <CourtCard
          key={c.id}
          court={c}
          meta={computedById[c.id]}
          selected={selectedId === c.id}
          onClick={() => onSelect(c.id)}
        />
      ))}
    </div>
  );
}
